import logo from './logo.svg';
import './App.css';
import Header from './components/header';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
import Posts from './components/posts';

function App() {
  return (
    <div className="App">
      <Header />
      <Router>
        <Switch>
          <Route path="/"><Posts /></Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
